export default function Board() {

    return (
        <div className="board">
            {[...Array(5)].map((_, row) => (
                <div key={row} className="row">
                    {[...Array(5)].map((_, col) => (
                        <div key={`${row}-${col}`} className="col">
                            {`${row}-${col}`}
                        </div>
                    ))}
                </div>
            ))}
        </div>
    );
}
